import React from 'react';
import styled from 'styled-components';
import { Form } from 'react-bootstrap';

const FormLegend = styled.legend`
  // border: 1px solid #000;
  padding: 0 10px;
`;

const FormSubmit = ({ onSubmit }) => {
  return(
    <div>
      <fieldset>
        <FormLegend>Insert an item</FormLegend>
        <form onSubmit={onSubmit}>
          <Form.Group>
            <Form.Control as="number" name="time_spent" required />
            <Form.Control as="select" name="time_spent" required>

            </Form.Control>
            <Form.Control as="date" name="time_spent" required />
          </Form.Group>
          <input type="number" name="time_spent" required/>
          <select name="activity" required>

          </select>
          <input type="date" name="date" required></input>

          <button type="submit">Add</button>
        </form>
      </fieldset>
    </div>
  );
}

export default FormSubmit;
